import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Screen1 from './Screen1';
import Screen2 from './Screen2'
//import AppContainer from './Apontador' //nota: s� de dar import ja da aquele erro...
import * as serviceWorker from './serviceWorker';
//O ideal seria por Apontar o AppContainer, que organiza a navega��o das telas...
//Ou... Usar o index direto como apontador... Mas nenhuma das op��es funcionaram, ambas chegam no erro do @babel/plugin-transform-flow-strip-types
ReactDOM.render(
  /*<React.StrictMode>
        <AppContainer />
  </React.StrictMode>,*/
  Screen1(),
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
